import React from 'react';
import {css} from 'emotion'
import { MDBView, MDBMask} from "mdbreact";

import graduation from '../graduation.jpg'


const Graduation = () => {
    return (
            <MDBView hover zoom>
                <img
                    className={styles.graduation}
                    src={graduation}
                    alt=""
                />
                <MDBMask className={styles.classname}>
                    <p>Graduation</p>
                </MDBMask>
            </MDBView>
    )
}

let classname = "flex-center";


const styles = {
    graduation: css`
    height: 100%;
    width: 75%;
    `,
    classname: css`
    align-text: center;
    color: white;
    `
}
export default Graduation;
